import React from "react";


export function Container({ children }) {
  return <div>{children}</div>;
}

export function Row({ fluid, children }) {
  return <div>{children}</div>;
}


export function Col({ size, children }) {
  return (
    <div
      className={size
        .split(" ")
        .map(size => "col-" + size)
        .join(" ")}
    >
      {children}
    </div>
  );
}
